import React, { useState } from 'react';
import Header from '../components/Header';
import './GoogleDriveNotes.css';

const initialFolderStructure = {
  name: 'Root',
  type: 'folder',
  contents: [
    { name: 'Folder1', type: 'folder', contents: [
      { name: 'File1.txt', type: 'file' },
      { name: 'File2.txt', type: 'file' }
    ]},
    { name: 'Folder2', type: 'folder', contents: [
      { name: 'File3.txt', type: 'file' },
      { name: 'Subfolder1', type: 'folder', contents: [
        { name: 'File4.txt', type: 'file' }
      ]}
    ]}
  ]
};

function GoogleDriveNotes() {
  const [currentFolder, setCurrentFolder] = useState(initialFolderStructure);
  const [navigationHistory, setNavigationHistory] = useState([]);

  const navigateToFolder = (folder) => {
    setNavigationHistory([...navigationHistory, currentFolder]);
    setCurrentFolder(folder);
  };

  const navigateBack = () => {
    const previousFolder = navigationHistory.pop();
    setCurrentFolder(previousFolder);
    setNavigationHistory([...navigationHistory]);
  };

  return (
    <div className="file-browser-page">
      <Header />
      <div className="file-browser">
        <div className="file-browser-header">
          {navigationHistory.length > 0 && (
            <button onClick={navigateBack} className="back-button">Back</button>
          )}
          <h2>{currentFolder.name}</h2>
        </div>
        <div className="file-browser-contents">
          {currentFolder.contents.map((item, index) => (
            <div
              key={index}
              className={`file-browser-item ${item.type}`}
              onClick={() => item.type === 'folder' && navigateToFolder(item)}
            >
              {item.name}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default GoogleDriveNotes;
